import App from '../../App';
import logo from '../../assets/images/Icon-likes.svg';
import './NavBar.scss';


function NavBar() {
    return (
        <>
            <header className="header">
                <nav className="nav-bar">
                    <a className="nav-bar__logo--link"><img className="nav-bar__logo" src={logo} alt="BrainFlix Logo"></img></a>
                </nav>
            </header>
        </>
    )
}
